import React from 'react';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';


const mapStateToProps = store => ({
    recipient: store.recipient,
    emails: store.emails,
    userInfos: store.userInfos
  });


class Header extends React.Component{
    constructor(props){
        super(props);
    }


    render() {
        return (
            <div className="Header">
                <span>
                    <li><Link to="/">Home</Link></li>
                    <li><Link to="/find">Address Finder</Link></li>
                    <li><Link to="/email">Campaign</Link></li>
                    <li><button id="authorize_button" onClick={this.props.handleAuthClick}>Authorize</button></li>
                    <li><button id="signout_button" onClick={this.props.handleSignoutClick}>Sign out</button></li>
                </span>
                {this.props.userInfos ? <img src={this.props.userInfos.picUrl}></img> : null}

            </div>
        )
    }


}

export default connect(
    mapStateToProps,
    )(Header);
